import HeaderPage from './HeaderPage'
import modelyback from './teslaimg/model-y-portrait@2.jfif'
const ModelY = () => {
    return (
        <HeaderPage
         title="Model X"
         background={modelxback}
         description="Plaid"
         range="640
         km"
         time="3.99s"
         speed="352
         km/h"
         horsepower="1,120hp"
         first
      />
      );
}
 
export default ModelY;
